import React from 'react'

const DietForm = ({handleChange, handleSubmit}) => {
    return (
        <div>
            <form onSubmit={handleSubmit}>
                <input type="text" name="query" onChange={handleChange} />
                <Button type="submit">Search</Button>
            </form>
        </div>
    )
}

export default DietForm
